import css from "./styles.scss";
import Link from "next/link";

const CardCover = ({ cover }) => {
	console.log(cover);
	return (
		<div className={css.profile}>
			<a><img src={cover.cover} title={cover.name}></img></a>
			<p>{cover.name}</p>
		</div>
	);
}

export default CardCover;
